INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (44, "人助けが大好き！　前向き格闘娘", 0, 16, "東山奈央", "トゥインクルウィッシュ", 8, 100101, "獣人族", "A", 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助け、応援", 2, 155, "ヒヨリ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (47, "戦闘のサポートが得意な、心優しい少女", 0, 17, "種田梨沙", "トゥインクルウィッシュ", 4, 100201, "ヒューマン", "O", 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "料理、人間観察", 2, 158, "ユイ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (46, "クールで何事にも真っ直ぐな剣士", 0, 18, "早見沙織", "トゥインクルウィッシュ", 1, 100301, "魔族", "B", 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "読書、乗馬、お茶", 2, 163, "レイ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (27, "探検好きのイタズラっ子", 0, 9, "諸星すみれ", "リトルリリカル", 8, 100401, "ヒューマン", "O", 10, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "いたずら、探検", 5, 128, "ミソギ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (40, "ヒーローに憧れる騎士見習いの少女", 0, 12, "下田麻美", "王宮騎士団（NIGHTMARE）", 11, 100501, "獣人族", "O", 25, "？？？", "ヒーローごっこ", 8, 146, "マツリ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (42, "甘え上手なみんなの人気者", 0, 13, "浅倉杏美", "悪魔偽王国軍（ディアボロス）", 11, 100601, "魔族", "O", 22, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "サックス", 7, 150, "アカリ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (32, "プリン大好きゴースト娘", 0, 14, "雨宮天", "悪魔偽王国軍（ディアボロス）", 1, 100701, "魔族", "B", 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリンを食べること", 7, 130, "ミヤコ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (40, "ボクは誰よりも美しい", 0, 14, "大空直美", "ヴァイスフリューゲル　ランドソル支部", 10, 100801, "エルフ", "AB", 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "鏡で自分を見ること", 15, 150, "ユキ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (45, "前世を信じる中二病患者、「疾風の冥姫」", 0, 17, "髙野麻美", "トワイライトキャラバン", 7, 100901, "魔族", "A", 5, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "小説執筆", 13, 159, "アンナ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (42, "マホマホ王国のプリンセス", 0, 16, "内田真礼", "自警団（カォン）", 9, 101001, "獣人族", "O", 22, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "空想、ぬいぐるみ集め", 10, 155, "マホ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (44, "人懐っこくてマシンガントークな妹系少女", 0, 15, "阿澄佳奈", "ラビリンス", 8, 101101, "ヒューマン", "A", 25, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "お裁縫", 3, 156, "リノ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (46, "みんなのために超能力を使う眠り姫", 0, 17, "大橋彩香", "フォレスティエ", 12, 101201, "エルフ", "A", 24, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "妹と遊ぶこと、二度寝、昼寝、早寝", 6, 156, "ハツネ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (55, "オタク全開な魔法少女", 0, 18, "佳村はるか", "トワイライトキャラバン", 8, 101301, "魔族", "O", 21, "", "読書、魔法", 13, 166, "ナナカ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (41, "頭脳明晰な美少女名探偵", 0, 15, "水瀬いのり", "自警団（カォン）", 11, 101401, "獣人族", "AB", 3, "test", "読書、推理", 10, 152, "カスミ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (54, "母性溢れる優しいみんなの「ミサト先生」", 0, 21, "國府田マリ子", "フォレスティエ", 9, 101501, "エルフ", "O", 5, "test", "絵本作り", 6, 165, "ミサト");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (48, "天真爛漫で人気者のカリスマモデル", 0, 18, "上坂すみれ", "ルーセント学院", 4, 101601, "魔族", "O", 10, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "ファッション", 14, 167, "スズナ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (53, "いつでも「なんくるないさ～」な天然娘", 0, 19, "高森奈津美", "自警団（カォン）", 7, 101701, "獣人族", "A", 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "踊り、空手", 10, 158, "カオリ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (52, "多くの男性を魅了する無垢な女教師", 0, 23, "伊藤静", "ルーセント学院", 8, 101801, "魔族", "B", 14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 14, 162, "イオ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (21, "お歌もにんじんも、ウサギさんも大好き♪", 0, 10, "日高里菜", "リトルリリカル", 4, 102001, "獣人族", "O", 3, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "かわいいもの集め", 5, 117, "ミミ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (40, "泣き虫で臆病な守ってあげたい女の子", 0, 12, "植田佳奈", "サレンディア救護院", 6, 102101, "ヒューマン", "B", 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", 9, 150, "クルミ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (40, "人見知りであまのじゃくな女の子", 0, 13, "原紗友里", "悪魔偽王国軍（ディアボロス）", 11, 102201, "魔族", "O", 22, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "ゲーム全般", 7, 150, "ヨリ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (38, "ぷうきちといつも一緒！", 0, 14, "芹澤優", "サレンディア救護院", 5, 102301, "ヒューマン", "B", 10, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "屋内でできる遊び", 9, 148, "アヤネ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (43, "お嬢さまのためにがんばるドジっ娘メイド", 0, 15, "悠木碧", "サレンディア救護院", 12, 102501, "ヒューマン", "O", 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "ご奉仕", 9, 154, "スズメ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (42, "遊びと睡眠が何より大事なぐうたら娘", 0, 17, "小岩井ことり", "牧場（エリザベスパーク）", 1, 102601, "獣人族", "B", 1, "test", "あんパン", 11, 144, "リン");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (43, "運命の相手に一途すぎる乙女", 0, 16, "橋本ちなみ", "トワイライトキャラバン", 7, 102701, "魔族", "B", 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "実験、裁縫、料理", 13, 154, "エリコ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (43, "救護院を経営する優しい庶民派お嬢様", 0, 17, "堀江由衣", "サレンディア救護院", 10, 102801, "エルフ", "A", 4, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "経営、お茶会", 9, 156, "サレン");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (40, "歌って踊れる大人気アイドル", 0, 17, "日笠陽子", "カルミナ", 1, 102901, "ヒューマン", "B", 24, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "舞台鑑賞、ダンス", 4, 157, "ノゾミ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (51, "トーゴクの神秘、オシエテクダサイ！", 0, 16, "佐藤聡美", "ヴァイスフリューゲル　ランドソル支部", 8, 103001, "ヒューマン", "O", 31, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "忍法開発", 15, 163, "ニノン");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (42, "占いが得意な霊能少女", 0, 18, "大坪由佳", "悪魔偽王国軍（ディアボロス）", 12, 103101, "魔族", "AB", 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占い", 7, 157, "シノブ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (45, "一人前の商人を目指すパワフルお嬢様", 0, 18, "松嵜麗", "メルクリウス財団", 3, 103201, "ヒューマン", "AB", 12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "慈善事業", 12, 157, "アキノ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (35, "みんなを笑顔にするお笑い牧場主", 0, 20, "新田恵海", "牧場（エリザベスパーク）", 3, 103301, "ヒューマン", "B", 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "漫才", 11, 142, "マヒル");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (55, "純情でほっとけない大人の女性", 0, 22, "今井麻美", "メルクリウス財団", 3, 103401, "エルフ", "A", 16, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "ウインドーショッピング", 12, 164, "ユカリ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (21, "礼儀正しくしっかり者のちびっ子優等生", 0, 8, "小倉唯", "リトルリリカル", 2, 103601, "エルフ", "A", 2, "test", "お勉強", 5, 118, "キョウカ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (43, "義理堅くてからかい好きな剣術少女", 0, 13, "茅原実里", "王宮騎士団（NIGHTMARE）", 8, 103701, "ヒューマン", "A", 11, "test", "剣術、年長者をからかう", 8, 149, "トモ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (40, "読書が趣味の病弱少女", 0, 14, "小清水亜美", "牧場（エリザベスパーク）", 11, 103801, "獣人族", "A", 3, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "読書、お散歩", 11, 153, "シオリ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (44, "「友達」に憧れる、エルフの森の女の子", 0, 13, "花澤香菜", "フォレスティエ", 6, 104001, "エルフ", "AB", 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "友達作りのイメトレ", 6, 158, "アオイ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (46, "人々を守るために歌う、唱喚士の少女", 0, 17, "福原綾香", "カルミナ", 6, 104201, "ヒューマン", "O", 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "各種楽器", 4, 163, "チカ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (54, "男勝りで情に厚いワイルド娘", 0, 17, "小松未可子", "自警団（カォン）", 8, 104301, "獣人族", "O", 9, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "お菓子作り", 10, 168, "マコト");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (50, "かつては夜を支配した最強の吸血鬼", 0, "??", "丹下桜", "悪魔偽王国軍（ディアボロス）", 5, 104401, "魔族", "A", 5, "test", "世界征服", 7, 172, "イリヤ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (49, "妄想大好き！　ほんとは照れ屋な女の子", 0, 18, "長妻樹里", "ヴァイスフリューゲル　ランドソル支部", 11, 104501, "ヒューマン", "AB", 19, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "小説を読むこと", 15, 157, "クウカ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (48, "弱きを助け強きをくじく猫娘", 0, 18, "沼倉愛美", "メルクリウス財団", 3, 104601, "獣人族", "AB", 1, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "猫とたわむれること", 12, 158, "タマキ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (50, "素顔を見せない冷静沈着な女性騎士", 0, 25, "川澄綾子", "王宮騎士団（NIGHTMARE）", 10, 104701, "ヒューマン", "A", 25, "？？？", "格闘技、湯浴み", 8, 171, "ジュン");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (49, "仕事も私事も効率優先な傭兵少女", 0, 20, "田所あずさ", "メルクリウス財団", 11, 104801, "ヒューマン", "O", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "傭兵などのアルバイト", 12, 163, "ミフユ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (54, "お姉ちゃんがお世話してあげるからねっ！", 0, 18, "生天目仁美", "ラビリンス", 10, 104901, "ヒューマン", "O", 24, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "家事全般", 3, 168, "シズル");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (22, "ちょっとおませな恋に恋する女の子", 0, 11, "久野美咲", "ルーセント学院", 1, 105001, "魔族", "A", 3, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ファッション誌鑑賞、コスメ集め", 14, 120, "ミサキ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (53, "実験が趣味の危険な科学者", 0, 27, "三石琴乃", "トワイライトキャラバン", 3, 105101, "ヒューマン", "A", 7, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "研究、実験", 13, 166, "ミツキ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (100, "乙女チックなもふもふアニマル", 0, 18, "徳井青空", "牧場（エリザベスパーク）", 3, 105201, "獣人族", "A", 14, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "毛繕い、お喋り", 11, 150, "リマ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (33, "見た目も中身もお子ちゃまな異国の軍人", 0, 18, "辻あゆみ", "ヴァイスフリューゲル　ランドソル支部", 7, 105301, "ヒューマン", "A", 28, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "お菓子屋通い", 15, 140, "モニカ");
