INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (45, "空への冒険を夢見る騎空士の少女", 0, 17, "金元寿子", "？？？", 3, 105701, "ヒューマン", "O", 10, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "冒険、おしゃべり", "", 156, "ジータ");
