INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (48, "弱きを助け強きをくじく猫娘", 0, 18, "沼倉愛美", "メルクリウス財団", 3, 107901, "獣人族", "AB", 1, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "猫とたわむれること", 12, 158, "タマキ（サマー）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (49, "仕事も私事も効率優先な傭兵少女", 0, 20, "田所あずさ", "メルクリウス財団", 11, 108001, "ヒューマン", "O", 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "傭兵などのアルバイト", 12, 163, "ミフユ（サマー）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (42, "占いが得意な霊能少女", 0, 18, "大坪由佳", "悪魔偽王国軍（ディアボロス）", 12, 108101, "魔族", "AB", 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占い", 7, 157, "シノブ（ハロウィン）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (32, "プリン大好きゴースト娘", 0, 14, "雨宮天", "悪魔偽王国軍（ディアボロス）", 1, 108201, "魔族", "B", 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリンを食べること", 7, 130, "ミヤコ（ハロウィン）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (22, "ちょっとおませな恋に恋する女の子", 0, 11, "久野美咲", "ルーセント学院", 1, 108301, "魔族", "A", 3, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ファッション誌鑑賞、コスメ集め", 14, 120, "ミサキ（ハロウィン）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (46, "人々を守るために歌う、唱喚士の少女", 0, 17, "福原綾香", "カルミナ", 6, 108401, "ヒューマン", "O", 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "各種楽器", 4, 163, "チカ（クリスマス）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (40, "泣き虫で臆病な守ってあげたい女の子", 0, 12, "植田佳奈", "サレンディア救護院", 6, 108501, "ヒューマン", "B", 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "観劇、おままごと", 9, 150, "クルミ（クリスマス）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (38, "ぷうきちといつも一緒！", 0, 14, "芹澤優", "サレンディア救護院", 5, 108601, "ヒューマン", "B", 10, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "屋内でできる遊び", 9, 148, "アヤネ（クリスマス）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (44, "人助けが大好き！　前向き格闘娘", 0, 16, "東山奈央", "トゥインクルウィッシュ", 8, 108701, "獣人族", "A", 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助け、応援", 2, 155, "ヒヨリ（ニューイヤー）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (47, "戦闘のサポートが得意な、心優しい少女", 0, 17, "種田梨沙", "トゥインクルウィッシュ", 4, 108801, "ヒューマン", "O", 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "料理、人間観察", 2, 158, "ユイ（ニューイヤー）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (46, "クールで何事にも真っ直ぐな剣士", 0, 18, "早見沙織", "トゥインクルウィッシュ", 1, 108901, "魔族", "B", 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "読書、乗馬、お茶", 2, 163, "レイ（ニューイヤー）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (43, "運命の相手に一途すぎる乙女", 0, 16, "橋本ちなみ", "トワイライトキャラバン", 7, 109001, "魔族", "B", 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "実験、裁縫、料理", 13, 154, "エリコ（バレンタイン）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (54, "お姉ちゃんがお世話してあげるからねっ！", 0, 18, "生天目仁美", "ラビリンス", 10, 109101, "ヒューマン", "O", 24, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "家事全般", 3, 168, "シズル（バレンタイン）");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (55, "英霊と契約を結んだマナリアの天才王女", 0, 17, "日笠陽子", "？？？", 12, 109201, "ヒューマン", "AB", 1, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "読書", "", 156, "アン");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (45, "マナリア魔法学院の新入生", 0, 15, "こやまきみこ", "？？？", 2, 109301, "ヒューマン", "O", 4, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "食べること、眠ること", "", 144, "ルゥ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (67, "人を超越した力を有す心優しい竜姫", 0, 17, "福原綾香", "？？？", 11, 109401, "半人半竜", "B", 3, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "ピアノ", "", 167, "グレア");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES (49, "妄想大好き！　ほんとは照れ屋な女の子", 0, 18, "長妻樹里", "ヴァイスフリューゲル　ランドソル支部", 11, 109501, "ヒューマン", "AB", 19, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "小説を読むこと", 15, 157, "クウカ（オーエド）");
